import React, { Component } from 'react'
import { BrowserRouter, Switch, Route } from 'react-router-dom'
import configLibrary from './Pages/configLibrary.js'
import examplePage from './Pages/example.js'
import './App.css';

class App extends Component {
  render() {
    return [
      <BrowserRouter>
        <Switch>
          <Route exact path='/' component={configLibrary} />
          <Route exact path='/old' component={examplePage} />
        </Switch>
      </BrowserRouter>
    ]
  }
}

export default App;
